    emailaddress: string;
    userpassword: string;
    fullname: string;
    university: number;
    course: string;
    yearOfStudy: number;
}


function signUp(values: SignUpInfo) {
    console.log("Service received");
    console.log(values);
    var config = {
        method: 'post',
        url: 'http://localhost:8080/api/user',
        headers: { 
          'Content-Type': 'application/json'
        },
        data : {
            "name": values.fullname,
             "email": values.emailaddress,
              "password": "sOmEpAsSwOrD",
               "schoolId": "5f9656274c30e3752780805f",
                "courseId": "5f9656274c30e37527808065",
                 "currentYear": 4
        }
      };


    axios(config)
        .then(function (response) {
            console.log("post is successful");
            console.log(response);
        })
        .catch(function (error) {
            console.log(error);
        });


}

export default {
    signUp
}
